syntax = "proto2";
option go_package = "proto/second_password_registration";
package second_password_registration;
import "google/protobuf/timestamp.proto";

message SecondPasswordRegistrationMsg {
    optional string user_id = 1;
    optional string request_header_location = 2;
    optional google.protobuf.Timestamp log_time = 3;
    optional string uuid = 4;
}